class UserForm extends Component {
    render(){
        return(
            <>
                <form>
                    <input type="text" placeholder='Nombre' name='name' />
                    <input type="email" placeholder='email' name='email' />
                    <input type='submit' value="Guardar"/>
                </form>
            </>
        )
    }
}
export default UserForm;
